import React from "react";
import "./About.css";
import restaurantImage from "../assets/images/restaurant.jpg"; // Pastikan path benar

const About = () => {
  return (
    <section id="about" className="about">
      <img src={restaurantImage} alt="Our Restaurant" />
      <div className="about-text">
        <h2>About WR Resto</h2>
        <p>
          WR Resto is dedicated to serving the best meals with fresh
          ingredients. Our mission is to bring you happiness through delicious
          food and excellent service.
        </p>
      </div>
    </section>
  );
};

export default About;
